import React from 'react';

function Dropdown() {
    return (
        <div class="dropdown">

        <button class="btn btn-outline-light dropdown-toggle" type="button" id="dropdownMenu1" data-toggle="dropdown"
                aria-haspopup="true" aria-expanded="false">IND</button>

        <div class="dropdown-menu dropdown-primary">
                <a class="dropdown-item" href="#">UK</a>
                <a class="dropdown-item" href="#">US</a>
                <a class="dropdown-item" href="#">IND</a>
                <a class="dropdown-item" href="#">CHINA</a>
            </div>
        </div>
    )
}
export default Dropdown;
